import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import Project1App from "./components/FileUploadpages/Account-Automation/App";
import Project2App from "./pages/Fraud-Detection/App";
import HomePage from "./pages/Main/App";  // Add a home or default landing page

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/project1" component={Project1App} />
        <Route path="/project2" component={Project2App} />
        <Route path="/" exact component={HomePage} />
      </Switch>
    </Router>
  );
}

export default App;
